import React from "react";
import styles from "./ProjectTable.module.css";

const ProjectTable = (props) => {
  return (
    <div className={styles.table_container}>
      <ul>
        <li>{props.year}</li>
        <li>{props.company}</li>
        <li>{props.title}</li>
        <li>{props.tag}</li>
      </ul>
    </div>
  );
};

export default ProjectTable;
